from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message

from stw_gen_sample3_api.types.core.can.can_bus_type import CanBus
from stw_gen_sample3_api.types.core.can.stats_type import Stats


@dataclass
class CanInfo(_Message):

    # Статистика по шине CAN1
    can1: Stats
    # Статистика по шине CAN2
    can2: Stats
    # Активная CAN-шина
    activeCan: CanBus


class CanInfoDict(TypedDict):

    # Статистика по шине CAN1
    can1: Union[Stats]

    # Статистика по шине CAN2
    can2: Union[Stats]

    # Активная CAN-шина
    activeCan: Union[CanBus]

